class Usuario:
  '''
  summary: vamos a hacer una clase usuario que se inicialice con sus atributos en None, que luego tenga métodos de set para poder ingresar sus datos
  y sus respectivos get para poder obtenerlos (a excepción de la clave por obvias razones).
  '''

  #Constructor
  def __init__(self):
    self.nombre = None
    self.correo = None
    #self.clave = None
    self.carpeta = []

  #Funciones de set

  #nombre
  def set_nombre(self, nombre):
    try:
      if not isinstance(nombre, str):
        raise TypeError("El parámetro debe ser un string")
      else:
        self.nombre = nombre
    except TypeError:
      raise

  #correo
  def set_correo(self, correo):
    try:
      if not isinstance(correo, str):
        raise TypeError("El parámetro debe ser un string")
      else:
        self.correo = correo
    except TypeError:
      raise

  #carpeta
  def set_carpeta(self, carpeta):
    try:
      if not isinstance(carpeta, Carpeta):
        raise TypeError("El parámetro debe ser un objeto de la clase Carpeta")
      else:
        self.carpeta.append(carpeta)
    except TypeError:
      raise

  #Funciones de get
  def get_nombre(self):
    return self.nombre

  def get_correo(self):
    return self.correo

  def get_carpeta(self):
    return self.carpeta

  def ver_carpetas(self):
    aux = []
    for folder in self.carpeta:
      aux.append(folder.get_nombre())
    return aux

"""Clase Mensaje"""

class Mensaje:
  '''
  summary: vamos a hacer una clase mensaje que se inicialice con sus atributos en None, que luego tenga métodos de set para poder ingresar sus datos
  y sus respectivos get para poder obtenerlos. Y además, vamos a hacer un método Crear Mensaje para
  '''
  def __init__(self):
    self.asunto = None
    self.cuerpo = None
    self.emisor = None
    self.receptor = None

  #Funciones de set individuales
  def set_asunto(self, asunto):
    try:
      if not isinstance(asunto, str):
        raise TypeError("El parámetro debe ser un string")
      else:
        self.asunto = asunto
    except TypeError:
      raise

  def set_cuerpo(self, cuerpo):
    try:
      if not isinstance(cuerpo, str):
        raise TypeError("El parámetro debe ser un string")
      else:
        self.cuerpo = cuerpo
    except TypeError:
      raise

  def set_emisor(self, emisor):
    try:
      if not isinstance(emisor, Usuario):
        raise TypeError("El parámetro debe ser un objeto de la clase Usuario")
      else:
        self.emisor = emisor
    except TypeError:
      raise

  def set_receptor(self, receptor):
    try:
      if not isinstance(receptor, Usuario):
        raise TypeError("El parámetro debe ser un objeto de la clase Usuario")
      else:
        self.receptor = receptor
    except TypeError:
      raise

  def get_asunto(self):
    return self.asunto

  def get_cuerpo(self):
    return self.cuerpo

  def get_emisor(self):
    return self.emisor

  def get_receptor(self):
    return self.receptor

  #Métodos generales
  def crear_mensaje(self, asunto=None, cuerpo=None, emisor=None, receptor=None): #Mover a clase Usuario?
    if not asunto:
      print("- Asunto no definido.")
    else:
      self.set_asunto(asunto)

    if not cuerpo:
      print("- Cuerpo no definido.")
    else:
      self.set_cuerpo(cuerpo)

    if not emisor:
      print("- Emisor no definido.")
    else:
      self.set_emisor(emisor)

    if not receptor:
      print("- Receptor no definido.")
    else:
      self.set_receptor(receptor)

  def imprimir_mensaje(self): #Mover a clase Usuario? x2
    print(f"Asunto: {self.get_asunto()}")
    print(f"Cuerpo: {self.get_cuerpo()}")

"""Clase Carpeta"""

class Carpeta:
  '''
  summary: vamos a hacer una clase carpeta que se inicialice con sus atributos en None, que luego tenga métodos de set para poder ingresar sus datos
  y sus respectivos get para poder obtenerlos. Además de tener funciones para ver los mensajes según su correspondiente asunto y otra para imprimirlos enteros.
  '''

  def __init__(self):
    self.nombre = None
    self.mensajes = []

  def set_nombre(self, nombre):
    try:
      if not isinstance(nombre, str):
        raise TypeError("El parámetro debe ser un string")
      else:
        self.nombre = nombre
    except TypeError:
      raise

  def add_mensaje(self, mensaje):
    try:
      if not isinstance(mensaje, Mensaje):
        raise TypeError("El parámetro debe ser un objeto de la clase Mensaje")
      else:
        self.mensajes.append(mensaje)
    except TypeError:
      raise

  def delete_mensaje(self, i):
    if not isinstance(i, int):
        raise TypeError("El parámetro debe ser un entero")

    if i < 0 or i >= len(self.mensajes):
        raise IndexError("El índice está fuera de rango")

    self.mensajes.pop(i)

  def get_nombre(self):
    return self.nombre

  def ver_mensajes(self):
    aux = []
    for mensaje in self.mensajes:
      aux.append(mensaje.get_asunto())
      #print(aux)
    return aux

  def imprimir_mensajes(self):
    for mensaje in self.mensajes:
      mensaje.imprimir_mensaje()

